def test_tapenade_config(header_filename, head, iv, delta, low, dim, z, jsf, asi, lbfs, bia):
    subprocess.run(['cp', f'headers/{header_filename}', '../headers'])
    subprocess.run(['cp', f'headers/{header_filename}', '../src/sico_specs.h'])

    cmd = f'python3 tapenade_config_pickup_bsi.py -head {head} -iv {iv} -jsf {jsf}'

    if delta is not None:
        cmd += f' -delta {delta}'
    if low is not None:
        cmd += f' -low {low}'
    if dim is not None:
        cmd += f' -dim {dim}'
    if z is not None:
        cmd += f' -z {z}'
    if lbfs is not None:
        cmd += f' -lbfs {lbfs}'
    if bia is not None:
        cmd += f' -bia {bia}'
    if asi is not None:
        cmd += f' -asi {asi}'
    subprocess.run(cmd, shell=True, check=True)

